import React from 'react';
import './HelpCenter.css'; // Import CSS file for styling

const HelpCenter = () => {
  return (
    <div className="help-center">
      <img src="/path/to/image.jpg" alt="Help Center Image" className="help-center-image" />
      <div className="help-center-content">
        <h2 className="help-center-title">Help Center</h2>
        <p className="help-center-description">
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nulla convallis libero quis lectus consectetur ultrices.
        </p>
        <div className="help-center-buttons">
          <button className="help-center-button">Action 1</button>

        </div>
      </div>
    </div>
  );
}

export default HelpCenter;
